INSERT INTO `AssetProfiles` VALUES ('ADVANCED MICRO DEVICES|||AMD', 'Technology', 'Semiconductors', 1.913, NULL, 357778423808, 'USD', 'Advanced Micro Devices, Inc. operates as a semiconductor company worldwide. It operates in three segments: Data Center, Client and Gaming, and Embedded. The company offers artificial intelligence (AI) accelerators, x86 microprocessors, and graphics processing units (GPUs) as standalone devices or as incorporated into accelerated processing units, chipsets, and data center and professional GPUs; and embedded processors and semi-custom system-on-chip (SoC) products, microprocessor and SoC development services and technology, data processing units, field programmable gate arrays (FPGA), system on modules, smart network interface cards, and adaptive SoC products. It provides processors under the AMD Ryzen, AMD Ryzen AI, AMD Ryzen PRO, AMD Ryzen Threadripper, AMD Ryzen Threadripper PRO, AMD Athlon, and AMD PRO A-Series brands; graphics under the AMD Radeon graphics and AMD Embedded Radeon graphics; professional graphics under the AMD Radeon Pro graphics brand; and AI and general-purpose compute infrastructure for hyperscale providers. The company offers data center graphics under the AMD Instinct accelerators and Radeon PRO V-series brands; server microprocessors under the AMD EPYC brand; low power solutions under the AMD Athlon, AMD Geode, AMD Ryzen, AMD EPYC, and AMD R-Series and G-Series brands; FPGA products under the Virtex-6, Virtex-7, Virtex UltraScale+, Kintex-7, Kintex UltraScale, Kintex UltraScale+, Artix-7, Artix UltraScale+, Spartan-6, and Spartan-7 brands; adaptive SOCs under the Zynq-7000, Zynq UltraScale+ MPSoC, Zynq UltraScale+ RFSoCs, Versal HBM, Versal Premium, Versal Prime, Versal AI Core, Versal AI Edge, Vitis, and Vivado brands; and compute and network acceleration board products under the Alveo and Pensando brands. It serves original equipment and design manufacturers, public cloud service providers, system integrators, distributors, and add-in-board manufacturers. The company was incorporated in 1969 and is headquartered in Santa Clara, California.', 'https://www.amd.com', NULL, '2025-12-02 12:34:11', '2025-12-02 12:34:11');
INSERT INTO `AssetProfiles` VALUES ('Alibaba Group Holding Ltd|||BABA', 'Consumer Cyclical', 'Internet Retail', 0.316, 0.64, 391923728384, 'USD', 'Alibaba Group Holding Limited, through its subsidiaries, provides technology infrastructure and marketing reach to help merchants, brands, retailers, and other businesses to engage with their users and customers in the People''s Republic of China and internationally. It operates digital retail platforms under the Taobao and Tmall names; wholesale marketplaces through 1688.com and Alibaba.com; global e-commerce platform under the AliExpress name; e-commerce platforms under the Lazada, Trendyol, and Daraz names; and consumer-to-consumer community and marketplace under the Tmall Global, Tmall Supermarket, and Xianyu names. The company also operates Cainiao, an e-commerce logistics solution; Ele.me, an on-demand delivery and local services platform; and Amap, a provider of mobile digital map, navigation, and real-time traffic information; Youku, an online video platform; and Damai Entertainment that provides content production, promotion and distribution, performance and event ticketing management, IP-related licensing and operations, cinema ticketing management, and internet data services for the entertainment industry. In addition, it provides elastic computing, storage, network, security, database, big data, cloud native, and Alibaba cloud model studio services; and hardware, software license and installation, and application development and maintenance services, as well as sells membership packages and subscriptions. Further, the company offers Freshippo, a retail platform for groceries and goods; Alibaba Health for medical and healthcare solutions; mobile games under the Lingxi Games name; UC Browser, an information service platform; Quark, an information services platform for young users; Fliggy, an online travel platform; and DingTalk, a collaboration workplace and enterprise management platform. Alibaba Group Holding Limited was incorporated in 1999 and is based in Causeway Bay, Hong Kong.', 'https://www.alibabagroup.com', NULL, '2025-12-02 12:34:11', '2025-12-02 12:34:11');
INSERT INTO `AssetProfiles` VALUES ('AMD', 'Technology', 'Semiconductors', 1.913, NULL, 357778423808, 'USD', 'Advanced Micro Devices, Inc. operates as a semiconductor company worldwide. It operates in three segments: Data Center, Client and Gaming, and Embedded. The company offers artificial intelligence (AI) accelerators, x86 microprocessors, and graphics processing units (GPUs) as standalone devices or as incorporated into accelerated processing units, chipsets, and data center and professional GPUs; and embedded processors and semi-custom system-on-chip (SoC) products, microprocessor and SoC development services and technology, data processing units, field programmable gate arrays (FPGA), system on modules, smart network interface cards, and adaptive SoC products. It provides processors under the AMD Ryzen, AMD Ryzen AI, AMD Ryzen PRO, AMD Ryzen Threadripper, AMD Ryzen Threadripper PRO, AMD Athlon, and AMD PRO A-Series brands; graphics under the AMD Radeon graphics and AMD Embedded Radeon graphics; professional graphics under the AMD Radeon Pro graphics brand; and AI and general-purpose compute infrastructure for hyperscale providers. The company offers data center graphics under the AMD Instinct accelerators and Radeon PRO V-series brands; server microprocessors under the AMD EPYC brand; low power solutions under the AMD Athlon, AMD Geode, AMD Ryzen, AMD EPYC, and AMD R-Series and G-Series brands; FPGA products under the Virtex-6, Virtex-7, Virtex UltraScale+, Kintex-7, Kintex UltraScale, Kintex UltraScale+, Artix-7, Artix UltraScale+, Spartan-6, and Spartan-7 brands; adaptive SOCs under the Zynq-7000, Zynq UltraScale+ MPSoC, Zynq UltraScale+ RFSoCs, Versal HBM, Versal Premium, Versal Prime, Versal AI Core, Versal AI Edge, Vitis, and Vivado brands; and compute and network acceleration board products under the Alveo and Pensando brands. It serves original equipment and design manufacturers, public cloud service providers, system integrators, distributors, and add-in-board manufacturers. The company was incorporated in 1969 and is headquartered in Santa Clara, California.', 'https://www.amd.com', NULL, '2025-12-02 12:32:17', '2025-12-02 12:32:17');
INSERT INTO `AssetProfiles` VALUES ('AMP:MC', 'Technology', 'Information Technology Services', 0.615, NULL, 402332416, 'EUR', 'Amper, S.A. provides technological, industrial, and engineering solutions for the defense, security, energy, sustainability, and telecommunications markets in Spain and internationally. The company engages in the developments of electronic warfare and naval platform; research, development, and implementation of advanced security solutions to protect people, assets, and critical environments; and providing of emergency services. It offers advanced communication, navigation, and surveillance systems for airports; and infrastructures and services for air operations. In addition, the company provides solutions for offshore wind power and photovoltaic system; energy and water management through smart grids and water systems, and electrical systems; waste management, reduction of atmospheric emissions, and promotion of circular economy and green hydrogen; and digitization of spaces. Further, the company offers communication services, including telecommunications networks, 5G communications and services, and other communications systems. Amper, S.A. was founded in 1956 and is based in Madrid, Spain.', 'https://www.grupoamper.com', NULL, '2025-12-02 12:32:19', '2025-12-02 12:32:19');
INSERT INTO `AssetProfiles` VALUES ('Amper SA|||AMP:MC', 'Technology', 'Information Technology Services', 0.615, NULL, 402332416, 'EUR', 'Amper, S.A. provides technological, industrial, and engineering solutions for the defense, security, energy, sustainability, and telecommunications markets in Spain and internationally. The company engages in the developments of electronic warfare and naval platform; research, development, and implementation of advanced security solutions to protect people, assets, and critical environments; and providing of emergency services. It offers advanced communication, navigation, and surveillance systems for airports; and infrastructures and services for air operations. In addition, the company provides solutions for offshore wind power and photovoltaic system; energy and water management through smart grids and water systems, and electrical systems; waste management, reduction of atmospheric emissions, and promotion of circular economy and green hydrogen; and digitization of spaces. Further, the company offers communication services, including telecommunications networks, 5G communications and services, and other communications systems. Amper, S.A. was founded in 1956 and is based in Madrid, Spain.', 'https://www.grupoamper.com', NULL, '2025-12-02 12:34:11', '2025-12-02 12:34:11');
INSERT INTO `AssetProfiles` VALUES ('Apple|||AAPL', 'Technology', 'Consumer Electronics', 1.109, 0.37, 4201314516992, 'USD', 'Apple Inc. designs, manufactures, and markets smartphones, personal computers, tablets, wearables, and accessories worldwide. The company offers iPhone, a line of smartphones; Mac, a line of personal computers; iPad, a line of multi-purpose tablets; and wearables, home, and accessories comprising AirPods, Apple Vision Pro, Apple TV, Apple Watch, Beats products, and HomePod, as well as Apple branded and third-party accessories. It also provides AppleCare support and cloud services; and operates various platforms, including the App Store that allow customers to discover and download applications and digital content, such as books, music, video, games, and podcasts, as well as advertising services include third-party licensing arrangements and its own advertising platforms. In addition, the company offers various subscription-based services, such as Apple Arcade, a game subscription service; Apple Fitness+, a personalized fitness service; Apple Music, which offers users a curated listening experience with on-demand radio stations; Apple News+, a subscription news and magazine service; Apple TV, which offers exclusive original content and live sports; Apple Card, a co-branded credit card; and Apple Pay, a cashless payment service, as well as licenses its intellectual property. The company serves consumers, and small and mid-sized businesses; and the education, enterprise, and government markets. It distributes third-party applications for its products through the App Store. The company also sells its products through its retail and online stores, and direct sales force; and third-party cellular network carriers and resellers. The company was formerly known as Apple Computer, Inc. and changed its name to Apple Inc. in January 2007. Apple Inc. was founded in 1976 and is headquartered in Cupertino, California.', 'https://www.apple.com', NULL, '2025-12-02 12:32:33', '2025-12-02 12:32:33');
INSERT INTO `AssetProfiles` VALUES ('AST SPACEMOBILE INC|||ASTS', 'Technology', 'Communication Equipment', 2.725, NULL, 14626155520, 'USD', 'AST SpaceMobile, Inc., together with its subsidiaries, designs and develops the constellation of BlueBird satellites in the United States. The company provides a cellular broadband network in space to be accessible directly by smartphones for commercial use and other applications, as well as for government use. Its SpaceMobile service provides cellular broadband services to end-users who are out of terrestrial cellular coverage. The company was founded in 2017 and is headquartered in Midland, Texas.', 'https://ast-science.com', NULL, '2025-12-02 12:34:11', '2025-12-02 12:34:11');
