INSERT INTO `AssetProfiles` VALUES ('BOW', 'Financial Services', 'Insurance - Property & Casualty', NULL, NULL, 937363264, 'USD', 'Bowhead Specialty Holdings Inc. provides commercial specialty property and casualty insurance products in the United States. It underwrites casualty insurance solutions for risks in the construction, distribution, heavy manufacturing, real estate, and hospitality segments; professional liability insurance solutions, including directors and officers liability, errors and omissions liability, employment practices liability, fiduciary liability, fidelity liability and miscellaneous professional liability, crime insurance, and cyber for financial institutions; and healthcare solutions for hospitals, senior care providers, managed care organizations, miscellaneous medical facilities, and management liability segments. In addition, it offers Baleen Specialty, a technology-powered underwriting operation, that specializes in small to mid-sized risks that are not eligible in the admitted market. The company distributes its products through distribution partners in wholesale and retail markets. Bowhead Specialty Holdings Inc. was formerly known as Bowhead Holdings Inc. and changed its name to Bowhead Specialty Holdings Inc. in March 2024. The company was founded in 2020 and is based in New York, New York.', 'https://bowheadspecialty.com', NULL, '2025-12-02 12:32:16', '2025-12-02 12:32:16');
