INSERT INTO `AssetProfiles` VALUES ('DIA:MC', 'Consumer Defensive', 'Discount Stores', 0.631, NULL, 1825814784, 'EUR', 'Distribuidora Internacional de Alimentación, S.A. engages in the wholesale and retail of food products in Spain and Argentina. The company offers product and services through own or franchised self-service stores. It is also involved in the distribution of food and toiletries; leasing of business premises; provision of services to suppliers; and lending and credit operations, including consumer loans, mortgages, and financing of commercial transactions, as well as issuing and managing of credit and debit cards. In addition, the company engages in the import, export, acquisition, distribution and wholesale, and retail sale of beverages, household goods, general, and other products for domestic use and consumption. Distribuidora Internacional de Alimentación, S.A. was incorporated in 1966 and is headquartered in Madrid, Spain.', 'https://diacorporate.com', NULL, '2025-12-02 12:32:19', '2025-12-02 12:32:19');
