INSERT INTO `AssetProfiles` VALUES ('Obrascon Huarte Lain SA|||OHLA:MC', 'Industrials', 'Engineering & Construction', NULL, NULL, 510814560, 'EUR', 'Obrascón Huarte Lain, S.A. engages in the construction and concession businesses in the United States, Canada, Mexico, Chile, Peru, Colombia, Spain, Central and Eastern Europe, Northern Europe, and internationally. It operates through Construction, Industrial, and Other segments. The company provides civil engineering and building construction services for public and private-sector customers; and designs, engineers, constructs, maintains, and operates industrial plants and systems, including oil and gas, renewable energy, mining and cement, solids engineering, and fire-fighting systems. In addition, it offers building renovation and consulting; technical advisory; IT; and management consultancy services. Further, the company engages in the installation and maintenance of security and fire protection systems; water treatment and distribution; development of a fossil fuel power plants; industrial engineering for a refinery; development and operation of hotels and leisure centres; finance, studies, and management; car park concession and operation; construction and development of real estate projects; and concession and operation of ports and marinas. The company was formerly known as Sociedad General de Obras y Construcciones Obrascón, S.A. Obrascón Huarte Lain, S.A. was incorporated in 1911 and is based in Madrid, Spain.', 'https://ohla-group.com', NULL, '2025-12-02 12:34:11', '2025-12-02 12:34:11');
